import React, { useState } from "react";
import { ImageBackground, StyleSheet, View, Button, Text } from "react-native";
import Timeline from "react-native-timeline-flatlist";

const data = [
  { title: "Flight Booked ", description: "Event 1 Description" },
  {
    title: "Get Digital Boarding Pass",
    description: "Event 2 Description",
  },
  { title: "Check-In Bags", description: "Event 3 Description" },
  { title: "Drop-Off Bags", description: "Event 4 Description" },
  { title: "Head to TSA", description: "Event 5 Description" },
];

const TimelinePage = () => (
  // const [isComplete, setIsComplete] = useState(false);

  <View>
    <Timeline data={data} columnFormat="two-column" />
  </View>
);

const styles = StyleSheet.create({});

export default TimelinePage;
